import React from 'react';
import { Link } from 'react-router-dom';
import './Unit.css';
import { unitNames, overview } from './content/UnitOverview'

function Unit({ unitIndex, subUnitList }){
    return (
        <div className="unit">
            <h2>Unit {unitIndex} - {unitNames[unitIndex - 1]}</h2>
            {overview[unitIndex - 1]}
            <Link to={`/unit${unitIndex + 1}/1`}>
                {children}
            </Link>
            <ul className="subunitList">{subUnitList}</ul>
        </div>
    );
};
export default Unit;
